import React from "react";
import { Link } from "react-router-dom";
import Logo from "../assets/chosto-logo.png";

export default function NavBar() {
  return (
    <nav className="bg-chostoBrown text-white p-4 flex justify-between items-center">
      <img
        src={Logo}
        alt="Chosto Logo"
        className="w-28 h-16 object-contain"
        />
      <h1 className="text-chostoPink text-xl font-bold">Chosto</h1>
      <div className="space-x-4">
        <Link to="/" className="hover:text-chostoPink">Home</Link>
        <Link to="/menu" className="hover:text-chostoPink">Menu</Link>
        <Link to="/about" className="hover:text-chostoPink">About</Link>
        <Link to="/contact" className="hover:text-chostoPink">Contact</Link>
        <Link to="/location" className="hover:text-chostoPink">Location</Link>
      </div>
    </nav>
  );
}
